    (10, null, '2020-09-28 20:00:31', '2020-09-28 20:00:31', 'Cupiditate itaque eos ratione quas nihil similique quis. Dignissimos voluptas magnam ratione labore. Repellat eum maiores qui qui quae sunt sed.', 23, 1, 2, 1478, 'East Carson', null, 54.57, 36.62),
    (54, null, '2020-09-29 11:30:44', '2020-09-29 11:39:19', 'Рядом с трассой под Ольховкой внезапно закончилось топливо. Нужна канистра с десятью литрами. Можно больше. Оплачу в тройном размере.', 2, 4, 1, 1324, 'Ольховка', null, 49.81, 44.61),
    (55, null, '2020-09-29 11:32:41', '2020-09-29 14:07:39', 'Съехал с МКАДа 200 метров к Черному озеру и застрял. Нелепо вышло - в 5 метрах от дороги. Нужно просто подтолкнуть. С меня 1500 рублей за помощь.', 2, 2, 1, 1291, 'Новокосино', null, 55.73, 37.84),
    (56, null, '2020-09-29 11:41:10', '2020-09-29 13:09:58', 'Рыбачил на Курчатовской водохранилище. Пошел дождь и выехать в горку не вышло. Нужна помощь внедорожника или цепи протовоскольжения. Оплачу топливо и 1000 рублей сверху.', 4, 1, 1, 1283, 'Курчатов', null, 51.66, 35.66),
    (57, null, '2020-09-29 11:43:03', '2020-09-29 11:53:21', 'Только выехал из Тольятти на новенькой Ладе, как нарвался на битое стекло. Необходим мобильный шиномонтаж или ремкомплект.', 4, 6, 2, 1308, 'Тольятти', 'member', 53.5, 49.54),
    (58, null, '2020-09-29 11:48:53', '2020-09-29 14:15:26', 'Сел аккумулятор от долгого прослушивания музыки. Нужно "прикурить" от другой машины. Буду рад оперативной помощи - что то похолодало неожиданно на улице.', 3, 5, 1, 909, 'СНТ Труд', null, 51.96, 75.63),
    (59, null, '2020-09-29 13:16:39', '2020-09-29 14:16:56', 'Требуется в аренду на 3 дня заклепочный гайковерт для рук с  автоматическим вылетом и гаечным пистолетом. Щедрое вознаграждение гарантирую!', 7, 3, 1, 1327, 'Губерево', null, 51.77, 39.04),
    (60, null, '2020-09-29 13:19:24', '2020-09-29 14:18:03', 'Требуется  приспособление для затачивания, многофункциональное 35мм, "61 в 1" Matrix.
        Куплю или возьму в аренду на три месяца. Обращаться в автосервис MegoDrive2+ по адресу Косторное улица Вязникова, д2 или пишите предложения тут.', 7, 3, 1, 1327, 'Касторное', null, 51.83, 38.12),
    (61, null, '2020-09-29 14:56:24', '2020-09-29 14:56:24', 'Застрял основательно, но рядом с дорогой. Фото прилагается. Прошу помощь за вознаграждение (1000рублей).', 11, 2, 1, 1772, 'Чугуев', null, 49.89, 36.67);

